        <script>
        (function(){
          var gd = document.querySelector('#stage .js-plotly-plot');
          function fit(){
            gd.style.height = '100vh';
            gd.style.width  = '100vw';
            Plotly.relayout(gd, {width: window.innerWidth, height: window.innerHeight});
            Plotly.Plots.resize(gd);
          }
          window.addEventListener('resize', fit);
          fit();

          // Rotation around center (data recentered in Python)
          var doRotate = true;
          var fps = 18;
          var step = 0.010, r=1.8, elev=0.7, theta=0.0;
          Plotly.relayout(gd, {'scene.camera.center': {x:0,y:0,z:0}, 'scene.aspectmode': 'data'});

          function setEye(){
            var eye={x:r*Math.cos(theta), y:r*Math.sin(theta), z:elev};
            Plotly.relayout(gd, {'scene.camera.eye': eye});
          }
          setInterval(function(){
            if(!doRotate || document.visibilityState !== 'visible') return;
            theta += step; setEye();
          }, Math.max(16, Math.floor(1000/Math.max(1,fps))));
          gd.addEventListener('mouseenter', function(){ doRotate = false; });
          gd.addEventListener('mouseleave', function(){ doRotate = true; });
        })();
        </script>
